"use strict";

import ParticleGroup from "./particleGroup.js";
import RainGroup from "./rainGroup.js";
import SnowGroup from "./snowGroup.js";
import Background from "./background.js";
import * as sound from "./sound.js";
import Preloader from "./preload.js";

class App {
    constructor(img) {
        this.isMobile = isMobileDevice();
        this.canvas = document.querySelector("canvas");
        this.ctx = this.canvas.getContext("2d");
        this.stageWidth = document.body.clientWidth;
        this.stageHeight = document.body.clientHeight;
        this.mouse = {
            x: null,
            y: null,
            radius: 100,
        };

        //모바일일때는 크기 다르게
        let particleImgWidth = 100;
        let particleImgHeight = 65;
        let backgroundImgWidth = 400;
        let backgroundImgHeight = 260;

        if (this.isMobile === false) {
            particleImgWidth *= 2;
            particleImgHeight *= 2;
            backgroundImgWidth *= 2;
            backgroundImgHeight *= 2;
        }

        this.particleGroup = new ParticleGroup(
            this.ctx,
            this.stageWidth,
            this.stageHeight,
            img,
            particleImgWidth,
            particleImgHeight,
            true
        );
        this.backGround = new Background(
            backgroundImgWidth,
            backgroundImgHeight
        );

        this.rainGroup = new RainGroup(this.stageWidth, this.stageHeight);
        this.SnowGroup = new SnowGroup(this.stageWidth, this.stageHeight);

        //ui버튼
        this.backgroundBtn = document.querySelector(".background");
        this.volumeBtn = document.querySelector(".volumeBtn");
        this.volumeIcon = this.volumeBtn.querySelector("i");
        this.isMusicOn = false;
        this.weatherBtn = document.querySelector(".weather");
        this.weatherIcon = this.weatherBtn.querySelector("i");
        this.isRain = true;
        this.resize();

        //모바일일때는 호버가 안됨
        if (this.isMobile === false) {
            this.backgroundBtn.classList.add("PC");
            this.volumeBtn.classList.add("PC");
            this.weatherBtn.classList.add("PC");
        }

        //event init
        this.eventInit();
    }

    eventInit() {
        //evnet init
        this.weatherBtn.addEventListener("click", () => {
            if (this.isRain) {
                this.weatherIcon.classList.remove("fa-tint");
                this.weatherIcon.classList.add("fa-snowflake");
            } else {
                this.weatherIcon.classList.remove("fa-snowflake");
                this.weatherIcon.classList.add("fa-tint");
            }
            this.isRain = !this.isRain;
        });

        this.volumeBtn.addEventListener("click", () => {
            if (this.isMusicOn) {
                this.volumeIcon.classList.remove("fa-volume-up");
                this.volumeIcon.classList.add("fa-volume-mute");
                sound.stopBackground();
            } else {
                this.volumeIcon.classList.remove("fa-volume-mute");
                this.volumeIcon.classList.add("fa-volume-up");
                sound.playBackground();
            }
            this.isMusicOn = !this.isMusicOn;
        });

        if (this.isMobile) {
            window.addEventListener("touchstart", (event) => {
                this.mouse.x = event.touches[0].clientX;
                this.mouse.y = event.touches[0].clientY;
            });
            window.addEventListener("touchmove", (event) => {
                this.mouse.x = event.touches[0].clientX;
                this.mouse.y = event.touches[0].clientY;
            });
            window.addEventListener("touchend", (event) => {
                this.mouse.x = 0;
                this.mouse.y = 0;
            });
        } else {
            window.addEventListener("mousemove", (event) => {
                this.mouse.x = event.x;
                this.mouse.y = event.y;
            });
        }

        window.addEventListener("resize", this.resize.bind(this));

        window.requestAnimationFrame(this.animate.bind(this));
    }

    resize() {
        this.stageWidth = document.body.clientWidth;
        this.stageHeight = document.body.clientHeight;

        //레티나 디스플레이를 위해서
        this.canvas.width = this.stageWidth * 2;
        this.canvas.height = this.stageHeight * 2;
        this.ctx.scale(2, 2);

        this.rainGroup.resize(this.stageWidth, this.stageHeight);
        this.SnowGroup.resize(this.stageWidth, this.stageHeight);
        this.particleGroup.resize(this.stageWidth, this.stageHeight);
    }

    animate() {
        this.ctx.fillStyle = "rgba(0,0,0, 1)";
        this.ctx.fillRect(0, 0, this.stageWidth, this.stageHeight);

        this.backGround.draw(
            this.ctx,
            this.stageWidth / 2,
            this.stageHeight / 2
        );

        if (this.isRain) {
            this.rainGroup.draw(this.ctx);
        } else {
            this.SnowGroup.draw(this.ctx);
        }

        this.particleGroup.draw(this.ctx, this.mouse);

        window.requestAnimationFrame(this.animate.bind(this));
    }
}

